  // TODO instead of just emptying
  //      we should use actions.destroyX(this,x)
  //      to properly free the allocated vecs/polys
  this.bodies.empty();
  this.obstacles.empty();
  this.pucks.empty();
  this.forces.empty();
  this.bullets.empty();
  this.paddles.empty();
  this.shields.empty();
  this.extras.empty();
  this.activeExtras.empty();

  this.removed.length = 0;
  this.added.length = 0;
