function availableActions(actions){
  var all = Object.keys(actions).filter(function(a){
    if( a.indexOf('puck') == 0 )
      return false;
    if( a.indexOf('bullet') == 0 )
      return false;
    return a.length > 4
        && ( a.indexOf('Create') != -1
          || a.indexOf('Destroy') != -1
          || a == 'gameOver' )
  });
  return [''].concat(all)
}

