require.register("paddle-battle/lib/actions/bullet.js", function(exports, require, module){
var debug = require('debug')('actions:bullet')
  , geom = require('geom')
  , poly = geom.poly
  , vec = geom.vec
  , BodyFlags = require('../geom-sim/body-flags')
  , shapes = require('../geom-sim/shapes')
  , settings = require('../settings');


// id is a generated id (ex 'a1' = player + (last shot id + 1))
// x, y is position it should start at
// v is the speed it should be moving with
exports.createBullet = function(world,paddle){
  debug('create',paddle)

  var p = world.paddles.get(paddle)
    , c = p.current
    , v = vec.make(0,paddle == world.me.paddle ? 30 : -30); // TODO might the the other way around...

  // TODO round x to unitSize

  // define a shape of the shot
  var shape = shapes.rect(settings.data.unitSize,150); // as in environment
  
  var paddleWidth = p.aabb[2] - p.aabb[0];
  
  var paddleCenter = c[0] + paddleWidth*.5
  var spawnX = Math.floor(paddleCenter/settings.data.unitSize)*settings.data.unitSize-settings.data.unitSize*.5

  // create a shot body
  var body = world.createBody(shape,spawnX,c[1]-v[1]*10, BodyFlags.DYNAMIC | BodyFlags.DESTROY);
  body.id = 'bullet';

  // push it in the right direction (based on `v`)
  vec.add(body.current,v,body.previous)
  vec.free(v)

  // save it for rendering and physics
  world.bullets.set(body.index,body)
}

exports.destroyBullet = function(world, bullet){
  debug('destroy',bullet.index)
  world.bullets.del(bullet.index)
  world.releaseBody(bullet)
}
});
require.register("paddle-battle/lib/actions/paddle.js", function(exports, require, module){
var debug = require('debug')('actions:paddle')
  , settings = require('../settings')
  , BodyFlags = require('../geom-sim/body-flags')
  , shapes = require('../geom-sim/shapes')
  , actions = require('../actions')
  , audio = require('../audio')
  , geom = require('geom')
  , poly = geom.poly
  , vec = geom.vec;


exports.createPaddle = function(world,player){
  debug('create',player)
  var aw = settings.data.arenaWidth
    , ah = settings.data.arenaHeight
    , u = settings.data.unitSize
    , w = u*4
    , h = u
    , x = aw/2
    , y = (player === world.players.b ? u : ah-u);
  var paddle = world.createBody(shapes.rect(w,h),x,y,BodyFlags.DYNAMIC | BodyFlags.BOUNCE | BodyFlags.STEER)
  paddle.id = 'paddle' // for debugging mostly
  paddle.damping = settings.data.paddleDamping;
  paddle.mass = settings.data.paddleMass;
  world.paddles.set(paddle.index,paddle)
  return paddle.index;
}

exports.hitPaddle = function(world,puck,paddle){
  // position audio
  // 0 = near, -10 = far away
  if( settings.data.sounds ){
    var aw = settings.data.arenaWidth
      , ah = settings.data.arenaHeight
      , ax = puck.current[0]/aw-.5*-0.8
      , ay = (1-puck.current[1]/ah)*-10
    audio.play3D("hit2", new THREE.Vector3(ax,0,ay));
  }

  var player = paddle.index == world.players.a.paddle ? 'a' : 'b';

  // mark who hit this particular puck last
  // not setting it on the puck to avoid modifying
  // the Body "class"
  world.lastHitPucks[puck.index] = player;
  world.puckBounces[puck.index] = (world.puckBounces[puck.index] || 0) + 1;

  // add some extra power to each hit
  // unit * (speed+speedup*bounces)
  // 20 * (1+0) > 20 * (1+.2) > 20 * (1+.4)
  // ex. 20 > 20 * 1.2 > 20 * 1.4 > ... > 20 * 4
  var level = world.level.puck.speed
    , speedup = world.level.puck.speedup
    , maxspeed = world.level.puck.maxspeed
    , bounces = world.puckBounces[puck.index]
    , speed = Math.min(level + speedup*bounces, maxspeed);

  // without paddle momentum
  // actions.puckSpeed(world,puck,speed)

  // with paddle momentum
  actions.puckSpeedMomentum(world,puck,speed,paddle.velocity)


  actions.emit('renderer','paddleHit',{player: player, velocity: puck.velocity})
}

exports.resizePaddle = function(world,paddle,size){
  // TODO size should be a multiplier (ex. .5 = 50%, 1.5 = 150%, 1 = 100%)
}

exports.movePaddle = function(world,paddle,dx){
  var p = world.paddles.get(paddle);
  p.current[0] += dx;
}
});
require.register("paddle-battle/lib/actions/puck.js", function(exports, require, module){
var debug = require('debug')('actions:puck')
  , actions = require('../actions')
  , settings = require('../settings')
  , BodyFlags = require('../geom-sim/body-flags')
  , shapes = require('../geom-sim/shapes')
  , geom = require('geom')
  , poly = geom.poly
  , vec = geom.vec;


exports.puckCreateCenter = function(world){
  // add to center of arena
  var x = settings.data.arenaWidth/2
    , y = settings.data.arenaHeight/2
    , mass = 5
    , p = this.puckCreate(world,x,y,mass);

  // always start with 0 "bounces"
  var speed = settings.data.unitSpeed * world.level.puck.speed;

  // TODO change the initial direction

  // start it off with a push
  this.puckSpeedXY(world, p, 0, speed)
}

exports.puckCreate = function(world, x, y, mass, flags){
  debug('create [%s] %s,%s %s', x, y, mass, flags)
  var w = settings.data.puckRadius*2
    , h = w // square
    , p = world.createBody(shapes.rect(w,h), x, y, flags || (BodyFlags.DYNAMIC | BodyFlags.BOUNCE))
  p.id = 'puck' // for debugging mostly
  world.pucks.set(p.index,p);
  return p;
}

exports.puckSpeed = function(world, p, s){
  debug('speed (current direction) [%s]',p.index, s)

  // it's probably a special case like:
  // "hit the end and the paddle in the same frame"
  // where one action will remove it and the other
  // set the speed. but warn just in case.
  if( !world.pucks.has(p.index) )
    return console.warn('cannot set puck speed, does not exist yet');

  // s = multiplier of unit speed (ex. speed*speedup^bounces)

  // only a speed (in the current direction)
  var v = vec.sub(p.current,p.previous)
  vec.norm(v,v)
  vec.smul(v,s*settings.data.unitSpeed,v)
  vec.sub(p.current,v,p.previous)
  vec.free(v)
}

exports.puckSpeedMomentum = function(world, p, s, m){
  debug('speed (w. momentum) [%s]',p.index, s, m)

  // see puckSpeed()
  if( !world.pucks.has(p.index) )
    return console.warn('cannot set puck speed, does not exist yet');

  // only a speed (in the current direction)
  var v = vec.sub(p.current,p.previous)
  vec.add(v,m,v)
  vec.norm(v,v)
  vec.smul(v,s*settings.data.unitSpeed,v)
  vec.sub(p.current,v,p.previous)
  vec.free(v)

}

exports.puckSpeedXY = function(world, p, x, y){
  debug('speed [%s]', p.index, x, y)

  // see puckSpeed()
  if( !world.pucks.has(p.index) )
    return console.warn('cannot set puck speed, does not exist yet');

  // set a speed and direction
  var v = vec.make(x,y)
  vec.sub(p.current,v,p.previous)
  vec.free(v)
}

exports.puckPush = function(world, p, x, y){
  debug('push [%s] %s,%s',p.index, x, y)
  if( !world.pucks.has(p.index) )
    throw new Error('cannot push puck, does not exist yet');
  p.applyForce(+x,+y);
}

exports.puckDestroy = function(world, puck){
  debug('destroy',puck.index)
  delete world.lastHitPucks[puck.index]
  delete world.puckBounces[puck.index]
  world.pucks.del(puck.index)
  world.releaseBody(puck)
}

exports.puckBounced = function(world,puck) {
  actions.emit('renderer','puckBounce',{puck: puck});
}


});
