  face[2].x = 1;
  face[2].y = marginRight;
  face[3].x = 1;
  face[3].y = 1;

  //top center
  face = uvs[1];
  face[0].x = marginLeft;
  face[0].y = 1;
  face[1].x = marginLeft;
  face[1].y = marginRight;
  face[2].x = marginBottom;
  face[2].y = marginRight;
  face[3].x = marginBottom;
  face[3].y = 1;

  //bottom left
  face = uvs[6];
  face[0].x = 0;
  face[0].y = marginTop;
  face[1].x = 0;
  face[1].y = 0;
  face[2].x = marginLeft;
  face[2].y = 0;
  face[3].x = marginLeft;
  face[3].y = marginTop;

  //bottom center
  face = uvs[7];
  face[0].x = marginLeft;
  face[0].y = marginTop;
  face[1].x = marginLeft;
  face[1].y = 0;
  face[2].x = marginBottom;
  face[2].y = 0;
  face[3].x = marginBottom;
  face[3].y = marginTop;

  //top bottom
  face = uvs[8];
  face[0].x = marginBottom;
  face[0].y = marginTop;
  face[1].x = marginBottom;
  face[1].y = 0;
  face[2].x = 1;
  face[2].y = 0;
  face[3].x = 1;
  face[3].y = marginTop;

  //center left
  var face = uvs[3];
  face[0].x = 0;
  face[0].y = marginRight;
