        this.hoverPos.z += ((Math.cos(-angle)*4000)-this.hoverPos.z)/14;

        this.camera.position = this.hoverPos.clone().multiplyScalar(this.hoverMix).add( this.animatedPos.clone().multiplyScalar(1-this.hoverMix) )

